import React from 'react'
import { useState } from 'react';
import Axios from 'axios'

const SignUp = () => {
    const [name, setName] = useState("");
    const [surname, setSurname] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [confirmPassword, setConfirmPassword] = useState("");



    const url = "http://localhost:3002/auth";

    const signUp = () => {

        const data = { name, surname, email, password, confirmPassword }

        Axios.post(url + "/signup", data)
            .then((response) => {
                console.log(response)
            })
            .catch((err) => {
                console.log(err)
            })

    }

    return (
        <div className="sign-up-form">
            <h1>Login</h1>
            <label>Name</label>
            <input type="text" onChange={(event) => { setName(event.target.value) }} />
            <label>Surnam</label>
            <input type="text" onChange={(event) => { setSurname(event.target.value) }} />
            <label>Email</label>
            <input type="text" onChange={(event) => { setEmail(event.target.value) }} />
            <label>Password</label>
            <input type="password" onChange={(event) => { setPassword(event.target.value) }} />
            <label>Confirm Password</label>
            <input type="password" onChange={(event) => { setConfirmPassword(event.target.value) }} />

            <button onClick={signUp}>Login</button>
        </div>
    )
}

export default SignUp
